import React, {Component} from 'react';


class AddProduct extends Component {
    constructor(props){
        super(props);

        this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit(event) {
        event.preventDefault();
    }
   
    render(){
        
        return(
            <form onSubmit={this.onSubmit}>
                <div>
                    <h3>Add Product</h3>
                    <input placeholder="Name" ref={nameInput = this.nameInput}/>
                    <input placeholder="Price"ref={priceInput = this.priceInput}/>
                    <button>Add</button>

                    <hr/>

                </div>
            </form>
        );
    }
}


export default AddProduct;
